          <div className="degisiklikler w-full flex justify-end flex-row">
            <span className="w-3/4 flex justify-end bg-slate-400">
              TÜRKÇE'YE GEÇ
            </span>
            <div className="w-1/4 dark-mode bg-slate-900">DARK MODE</div>
          </div>
        </div>
      </section>
    </>
  );
}
